import React, {Component} from 'react';
import Particles from 'react-particles-js';
import Navigation from './components/Navigation/Navigation.js';
import Logo from './components/LOGO/Logo.js';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm.js'; 
import Rank from './components/Rank/Rank.js'; 
import './App.css';


const particleOptions={
	particles: {
		number:{
			value: 80,
			density:{
				enable:true,
				value_area:800	
			}
		}

	}
}
const interactivityOptions={
	interactivity: {
      detect_on: 'canvas',
      events: {
        onhover: {
          enable: true,
          mode: 'repulse'
        },
        onclick: {
          enable: true,
          mode: 'push'
        },
        resize: true
      },
      modes: {
        grab:{
          distance: 100,
          line_linked:{
            opacity: 1
          }
        },
        bubble:{
          distance: 200,
          size: 80,
          duration: 0.4
        },
        repulse:{
          distance: 200,
          duration: 0.4
        },
        push:{
          particles_nb: 4
        },
        remove:{
          particles_nb: 2
        }
      },
      mouse:{}
    },
}

class App extends Component {
  render() {
    return (
    <div className="App">
    	<Particles className='particles'
    	params={particleOptions}
    	/>
    	<interactivity className='activity'
    	params={interactivityOptions}
    	/>
	<Navigation/> 
	<Logo/> 
	<Rank/>
	<ImageLinkForm/>

	</div>
    );
  }
}

export default App;


